import itertools
import numpy as np
import matplotlib.pyplot as plt
import matplotlib.gridspec as gridspec

from matplotlib.patches import Polygon
from matplotlib.patches import Ellipse
from shapely import affinity
from shapely.geometry.point import Point

xlim = (5, 35)
ylim = (-0.5, 2)

def create_ellipse(center, lengths, angle=0):
	circ = Point(center).buffer(1)
	ell = affinity.scale(circ, lengths[0], lengths[1])
	ellr = affinity.rotate(ell, angle)
	return ellr


def compare_ellipse(ellipse1, ellipse2, label1, label2, c1, c2, ax):
	# first ellipse in blue
	ax.set_xlim(xlim)
	ax.set_ylim(ylim)
	center, width, height, angle = ellipse1.center, ellipse1.width,  ellipse1.height, ellipse1.angle
	ellipse1 = create_ellipse(center, (width / 2, height / 2), angle)
	verts1 = np.array(ellipse1.exterior.coords.xy)
	patch1 = Polygon(verts1.T, color=c1, alpha=0.5, label=label1)
	ax.add_patch(patch1)

	# second ellipse in red
	center, width, height, angle = ellipse2.center, ellipse2.width, ellipse2.height, ellipse2.angle
	ellipse2 = create_ellipse(center, (width / 2, height / 2), angle)
	verts2 = np.array(ellipse2.exterior.coords.xy)
	patch2 = Polygon(verts2.T, color=c2, alpha=0.5, label=label2)
	ax.add_patch(patch2)

	# the intersect will be outlined in black
	intersect = ellipse1.intersection(ellipse2)
	verts3 = np.array(intersect.exterior.coords.xy)
	patch3 = Polygon(verts3.T, facecolor='none', edgecolor='black', lw=2)
	ax.add_patch(patch3)

	# compute areas
	print('= ' * 10)
	print(f'area of ellipse 1 ({label1}): {ellipse1.area}')
	print(f'area of ellipse 2 ({label2}): {ellipse2.area}')
	print(f'area of intersect: {intersect.area}')
	print(f'intersect/ellipse {label1}:', intersect.area / ellipse1.area)
	print(f'intersect/ellipse {label2}:', intersect.area / ellipse2.area)
	print(f'IOU:', intersect.area / (ellipse1.area + ellipse2.area - intersect.area))
	ax.set_title(f'IOU: {intersect.area / (ellipse1.area + ellipse2.area - intersect.area):.3f}')
	ax.legend()

def get_cov_ellipse(cov, centre, nstd, **kwargs):
	"""
	Return a matplotlib Ellipse patch representing the covariance matrix
	cov centred at centre and scaled by the factor nstd.
	"""
	# Find and sort eigenvalues and eigenvectors into descending order
	eigvals, eigvecs = np.linalg.eigh(cov)
	kek1, kek2 = eigvals, eigvecs
	order = eigvals.argsort()[::-1]
	eigvals, eigvecs = eigvals[order], eigvecs[:, order]

	# The anti-clockwise angle to rotate our ellipse by
	vx, vy = eigvecs[:, 0][0], eigvecs[:, 0][1]
	theta = np.arctan2(vy, vx)

	# Width and height of ellipse to draw
	width, height = 2 * nstd * np.sqrt(eigvals)
	# ##############
	# for axis, color in zip(eigvecs, ["red", "green"]):
	# 	#     start, end = mu, mu + sigma * axis ### leads to "ValueError: too many values to unpack (expected 2)"
	# 	# So I tried this but I don't think it's correct
	# 	start, end = centre, (centre + axis)
	# 	plt.annotate('', xy=end, xytext=start, arrowprops=dict(facecolor=color, width=1.0))

	#############
	return Ellipse(xy=centre, width=width, height=height, angle=np.degrees(theta), **kwargs)

def form_ellipses(data, colors, labels, ax):
	ellipses = []
	for (x, y), color, label in zip(data, colors, labels):
		x = np.array(x)
		y = np.array(y)
		mask = x < 5
		x[mask] += 25

		covariance = np.cov(x, y)
		x_mean = np.mean(x)
		y_mean = np.mean(y)
		ellipse = get_cov_ellipse(covariance, (x_mean, y_mean), 3, fc=color, alpha=0.3, ec=color, lw=1)

		ax.scatter(x, y, color=color, label=label, s=3)
		ax.add_artist(ellipse)
		ellipses.append((ellipse, label, color))

	return ellipses


